import { render } from "@testing-library/react";



const CitySelector = (location) => {
    
        
    
      

        
   
        return(
            <DropdownButton id="dropdown-basic-button" title="Dropdown button">
                <Dropdown.Item href="#/action-1" onClick={CitySelector('melbourne')}>Melbourne</Dropdown.Item>
                <Dropdown.Item href="#/action-2" onClick={CitySelector('sydney')}>Sydney</Dropdown.Item>
            </DropdownButton>
        )
    
}

export default CitySelector
